INSERT INTO `products` (`id`, `name`, `description`, `price`, `quantity`, `image`, `category_id`, `created_at`, `updated_at`, `expiration_date`, `unit`, `purchase`) VALUES
(0, 'cam sành', 'Cam sành là một trong những giống cam ngon và nổi tiếng nhất của Việt Nam, được nhiều người tiêu dùng ưa chuộng nhờ vỏ xanh sẫm, ruột cam rực rỡ, vị ngọt đậm và mọng nước. Đặc biệt, cam sành không chỉ dễ ăn mà còn mang lại nhiều lợi ích cho sức khỏe nhờ hàm lượng vitamin C và chất chống oxy hóa cao.', 20000, 800, 'uploads/68342232b992e.jpg', 1, '2025-05-25 15:26:11', '2025-05-29 16:03:21', '2025-06-01', 'KG', 10000),
(1, 'Nho', 'Nho Đà Lạt, đặc biệt là nho thân gỗ và nho móng tay, là những loại nho nổi bật với hương vị thơm ngon và giá trị dinh dưỡng cao, thu hút nhiều du khách đến tham quan và thưởng thức.', 200000, 700, 'uploads/683855ff153ea.jpg', 1, '2025-05-29 12:30:46', '2025-05-30 13:47:37', '2025-06-06', 'KG', 100000),
(2, 'Mận', 'đặc sản Lai Châu, từ nguồn gốc, quá trình trồng trọt, thời điểm mùa mận chín Lai Châu, đến những trải nghiệm thưởng thức trái mận Lai Châu', 100000, 800, 'uploads/68385642cb6d2.jpg', 1, '2025-05-29 12:30:46', '2025-05-29 16:07:40', '0000-00-00', 'KG', 30000),
(3, 'bưởi', 'Bưởi là một trong những loại trái cây đặc sản nổi bật của Việt Nam, được ưa chuộng nhờ hương vị thanh mát, múi to mọng nước, dễ bóc và vị ngọt nhẹ hoặc chua dịu tùy giống.', 50000, 700, 'uploads/6834220ff4124.jpg', 1, '2025-05-25 15:46:31', '2025-05-29 18:03:29', '2025-06-05', 'KG', 25000),
(4, 'táo', 'Táo Việt Nam là loại trái cây được yêu thích nhờ vị ngọt nhẹ, giòn rụm và hàm lượng dinh dưỡng dồi dào. Được trồng chủ yếu tại các vùng khí hậu ôn đới như Ninh Thuận, Lâm Đồng, Sơn La…, táo Việt mang đến sự tươi ngon thuần khiết và an toàn tuyệt đối cho người sử dụng.', 15000, 800, 'uploads/68341ec658188.jpg', 1, '2025-05-25 15:51:50', '2025-05-29 18:03:29', '2025-06-05', 'KG', 10000),
(5, 'quýt', 'Quýt Việt Nam là loại trái cây được người tiêu dùng ưa chuộng nhờ vị ngọt thanh mát, dễ ăn và hàm lượng vitamin C dồi dào. Trái quýt có vỏ mỏng, dễ bóc, múi tách đều, mọng nước, thơm nhẹ tự nhiên – là món ăn vặt lý tưởng cho cả người lớn và trẻ em.', 12000, 500, 'uploads/68341eaf0af4e.jpg', 1, '2025-05-25 15:52:22', '2025-05-29 18:03:29', '2025-06-05', 'KG', 8000),
(6, 'xoài', 'Xoài Việt Nam là loại trái cây nhiệt đới nổi tiếng với hương vị thơm ngon, hình dáng bắt mắt và giá trị dinh dưỡng cao. Tùy theo vùng miền và giống, xoài có thể có vỏ xanh hoặc vàng, thịt vàng ươm, dẻo ngọt hoặc giòn thanh – phù hợp với nhiều khẩu vị.', 30000, 800, 'uploads/68341e88817e1.jpg', 1, '2025-05-25 16:28:26', '2025-05-29 16:03:21', '2025-06-30', 'KG', 1500),
(7, 'chôm chôm', 'hôm chôm – loại trái cây đặc trưng của vùng nhiệt đới – từ lâu đã trở thành niềm tự hào của nông sản Việt Nam. Với lớp vỏ gai mềm đỏ rực, bên trong là phần thịt trắng trong, mọng nước và vị ngọt thanh mát, chôm chôm Việt Nam không chỉ hấp dẫn về hình thức mà còn tuyệt vời về hương vị.', 50000, 500, 'uploads/68341e73b9154.jpg', 1, '2025-05-25 16:32:47', '2025-05-29 16:07:40', '2025-06-30', 'KG', 20000),
(8, 'dưa vàng', 'Dưa vàng Việt Nam là loại trái cây cao cấp với hương thơm dịu nhẹ, vị ngọt thanh mát và hàm lượng dinh dưỡng dồi dào. Vỏ ngoài màu vàng óng đặc trưng, ruột vàng cam hoặc trắng ngà (tùy giống), thịt giòn, mọng nước và dễ ăn. Loại quả này không chỉ hấp dẫn về hương vị mà còn mang lại nhiều lợi ích cho sức khỏe.', 50000, 500, 'uploads/683415aad1a01.jpg', 1, '2025-05-26 07:18:02', '2025-05-29 16:03:21', '2025-05-08', 'KG', 10000),
(9, 'áo len', 'áo len siêu đẹp', 300000, 500, 'uploads/6834171b47587.jpg', 2, '2025-05-26 07:24:11', '2025-05-29 16:03:21', '2026-05-22', 'Cái', 50000),
(10, 'Dưa hấu Long An', 'Dưa hấu Long An – đặc sản nổi tiếng từ vùng đất miền Tây sông nước – là sự kết tinh của nắng gió, phù sa và bàn tay cần cù của người nông dân. Với lớp vỏ xanh sẫm, ruột đỏ rực rỡ, dưa hấu Long An không chỉ bắt mắt mà còn chinh phục vị giác bởi vị ngọt thanh mát, mọng nước tự nhiên.', 20000, 2000, 'uploads/68341bfa1373c.jpg', 1, '2025-05-26 07:44:58', '2025-05-29 16:03:21', '2025-05-30', 'KG', 10000),
(11, 'Áo sói cô đọc', 'Áo sói cô độc là những mẫu áo thun, áo phông, áo sơ mi hay áo khoác có in hình của chú sói.', 100000, 750, 'uploads/683856cf658ae.jpg', 2, '2025-05-29 12:13:37', '2025-05-29 16:07:40', '2027-11-29', 'Cái', 60000),
(12, 'áo khoác nam', 'Áo khoác thời trang nam giữ ấm tốt', 250000, 800, 'uploads/6838699915818.jpg', 2, '2025-05-29 11:26:36', '2025-05-29 16:07:40', '2026-05-29', 'Cái', 150000),
(13, 'áo sơ mi trắng', 'Áo sơ mi trắng công sở dành cho nam', 180000, 1000, 'uploads/683869c1cf666.jpg', 2, '2025-05-29 11:26:36', '2025-05-29 14:27:08', '2026-05-29', 'Cái', 100000),
(14, 'áo thun nữ', 'Áo thun cotton thoáng mát dành cho nữ', 120000, 1000, 'uploads/683869c9edce2.jpg', 2, '2025-05-29 11:26:36', '2025-05-29 14:27:08', '2026-05-29', 'Cái', 70000),
(15, 'váy dài', 'Váy dài nữ tính phù hợp cho mùa hè', 220000, 1000, 'uploads/683869d337e96.jpg', 2, '2025-05-29 11:26:36', '2025-05-29 14:27:08', '2026-05-29', 'Cái', 130000),
(16, 'quần jeans nam', 'Quần jeans bền đẹp dành cho nam', 300000, 400, 'uploads/683869db79f16.jpg', 2, '2025-05-29 11:26:36', '2025-05-29 16:03:21', '2026-05-29', 'Cái', 200000),
(17, 'quần short nữ', 'Quần short trẻ trung dành cho nữ', 150000, 300, 'uploads/68386a3f8f34e.jpg', 2, '2025-05-29 11:26:36', '2025-05-29 16:03:21', '2026-05-29', 'Cái', 80000),
(18, 'áo hoodie', 'Áo hoodie nỉ ấm áp cho mùa đông', 270000, 500, 'uploads/68386a36e7ff7.jpg', 2, '2025-05-29 11:26:36', '2025-05-29 16:13:02', '2026-05-29', 'Cái', 160000),
(19, 'váy công sở', 'Váy công sở thanh lịch, chất liệu cao cấp', 320000, 500, 'uploads/68386a2b16846.jpg', 2, '2025-05-29 11:26:36', '2025-05-29 16:13:02', '2026-05-29', 'Cái', 180000),
(20, 'áo len cổ lọ', 'Áo len cổ lọ giữ ấm tốt, thời trang', 210000, 400, 'uploads/68386a20596b2.jpg', 2, '2025-05-29 11:26:36', '2025-05-29 16:13:02', '2026-05-29', 'Cái', 120000),
(21, 'bộ đồ thể thao', 'Bộ đồ thể thao co giãn thoải mái', 250000, 100, 'uploads/68386a12a1571.jpg', 2, '2025-05-29 11:26:36', '2025-05-29 16:13:02', '2026-05-29', 'Bộ', 140000),
(22, 'Tai nghe Bluetooth', 'Tai nghe không dây chất lượng âm thanh cao', 550000, 800, 'uploads/683857338109e.jpg', 3, '2025-05-29 11:27:37', '2025-05-29 16:13:02', '2026-05-29', 'Cái', 300000),
(23, 'Loa mini di động', 'Loa Bluetooth nhỏ gọn, pin lâu', 700000, 800, 'uploads/68385752751df.jpg', 3, '2025-05-29 11:27:37', '2025-05-29 16:13:02', '2026-05-29', 'Cái', 450000),
(24, 'Sạc dự phòng 10000mAh', 'Sạc nhanh, dung lượng cao', 350000, 800, 'uploads/68386906e749b.jpg', 3, '2025-05-29 11:27:37', '2025-05-29 16:13:02', '2026-05-29', 'Cái', 200000),
(25, 'Bàn phím cơ', 'Bàn phím cơ học dành cho game thủ', 1200000, 800, 'uploads/68386919eaef8.jpg', 3, '2025-05-29 11:27:37', '2025-05-29 16:13:02', '2026-05-29', 'Cái', 800000),
(26, 'Chuột không dây', 'Chuột Bluetooth tiện lợi cho laptop', 250000, 500, 'uploads/683869354d7d7.jpg', 3, '2025-05-29 11:27:37', '2025-05-29 16:13:02', '2026-05-29', 'Cái', 150000),
