(29, 'Màn hình LED 24 inch', 'Màn hình LED Full HD cho PC', 2200000, 300, 'uploads/6838696a5dbba.jpg', 3, '2025-05-29 11:27:37', '2025-05-29 16:13:02', '2026-05-29', 'Cái', 1600000),
(30, 'Bộ phát WiFi', 'Router phát sóng mạnh, hỗ trợ 2 băng tần', 890000, 500, 'uploads/6838697897eab.jpg', 3, '2025-05-29 11:27:37', '2025-05-29 16:13:02', '2026-05-29', 'Cái', 600000),
